import React from 'react'
import "./Possibility.css"
const WOMAN = require("../gpt-3 assets/possibility.png")

function Possibility() {
  return (
    <div>
        <img 
            src={WOMAN}
            alt="possibility--image"
            className='possibility__image'
        />
        <div>
            <p></p>
        </div>
    </div>
  )
}

export default Possibility
